                // set up pointers to (SG|g(r,r')|SS)^(m+1) integrals

                auto g21_xxxx_0 = primBuffer.data(g21off + 15 * idx);

                auto g21_xxxy_0 = primBuffer.data(g21off + 15 * idx + 1);

                auto g21_xxxz_0 = primBuffer.data(g21off + 15 * idx + 2);

                auto g21_xxyy_0 = primBuffer.data(g21off + 15 * idx + 3);

