                auto g21_xyzz_0 = primBuffer.data(g21off + 15 * idx + 8);

                auto g21_xzzz_0 = primBuffer.data(g21off + 15 * idx + 9);

                auto g21_yyyy_0 = primBuffer.data(g21off + 15 * idx + 10);

                auto g21_yyyz_0 = primBuffer.data(g21off + 15 * idx + 11);

                auto g21_yyzz_0 = primBuffer.data(g21off + 15 * idx + 12);

                auto g21_yzzz_0 = primBuffer.data(g21off + 15 * idx + 13);

                auto g21_zzzz_0 = primBuffer.data(g21off + 15 * idx + 14);

                // set up pointers to (SH|g(r,r')|SS)^(m) integrals

                auto g10_xxxxx_0 = primBuffer.data(g10off + 21 * idx);

                auto g10_xxxxy_0 = primBuffer.data(g10off + 21 * idx + 1);

                auto g10_xxxxz_0 = primBuffer.data(g10off + 21 * idx + 2);

                auto g10_xxxyy_0 = primBuffer.data(g10off + 21 * idx + 3);

                auto g10_xxxyz_0 = primBuffer.data(g10off + 21 * idx + 4);

                auto g10_xxxzz_0 = primBuffer.data(g10off + 21 * idx + 5);

                auto g10_xxyyy_0 = primBuffer.data(g10off + 21 * idx + 6);

                auto g10_xxyyz_0 = primBuffer.data(g10off + 21 * idx + 7);

                auto g10_xxyzz_0 = primBuffer.data(g10off + 21 * idx + 8);

                auto g10_xxzzz_0 = primBuffer.data(g10off + 21 * idx + 9);

                auto g10_xyyyy_0 = primBuffer.data(g10off + 21 * idx + 10);

                auto g10_xyyyz_0 = primBuffer.data(g10off + 21 * idx + 11);

                auto g10_xyyzz_0 = primBuffer.data(g10off + 21 * idx + 12);

                auto g10_xyzzz_0 = primBuffer.data(g10off + 21 * idx + 13);

                auto g10_xzzzz_0 = primBuffer.data(g10off + 21 * idx + 14);

                auto g10_yyyyy_0 = primBuffer.data(g10off + 21 * idx + 15);

                auto g10_yyyyz_0 = primBuffer.data(g10off + 21 * idx + 16);

                auto g10_yyyzz_0 = primBuffer.data(g10off + 21 * idx + 17);

                auto g10_yyzzz_0 = primBuffer.data(g10off + 21 * idx + 18);

                auto g10_yzzzz_0 = primBuffer.data(g10off + 21 * idx + 19);

                auto g10_zzzzz_0 = primBuffer.data(g10off + 21 * idx + 20);

                // set up pointers to (SH|g(r,r')|SS)^(m+1) integrals

                auto g11_xxxxx_0 = primBuffer.data(g11off + 21 * idx);

                auto g11_xxxxy_0 = primBuffer.data(g11off + 21 * idx + 1);

                auto g11_xxxxz_0 = primBuffer.data(g11off + 21 * idx + 2);

                auto g11_xxxyy_0 = primBuffer.data(g11off + 21 * idx + 3);

                auto g11_xxxyz_0 = primBuffer.data(g11off + 21 * idx + 4);

                auto g11_xxxzz_0 = primBuffer.data(g11off + 21 * idx + 5);

                auto g11_xxyyy_0 = primBuffer.data(g11off + 21 * idx + 6);

                auto g11_xxyyz_0 = primBuffer.data(g11off + 21 * idx + 7);

                auto g11_xxyzz_0 = primBuffer.data(g11off + 21 * idx + 8);

                auto g11_xxzzz_0 = primBuffer.data(g11off + 21 * idx + 9);

                auto g11_xyyyy_0 = primBuffer.data(g11off + 21 * idx + 10);

                auto g11_xyyyz_0 = primBuffer.data(g11off + 21 * idx + 11);

                auto g11_xyyzz_0 = primBuffer.data(g11off + 21 * idx + 12);

                auto g11_xyzzz_0 = primBuffer.data(g11off + 21 * idx + 13);

                auto g11_xzzzz_0 = primBuffer.data(g11off + 21 * idx + 14);

                auto g11_yyyyy_0 = primBuffer.data(g11off + 21 * idx + 15);

                auto g11_yyyyz_0 = primBuffer.data(g11off + 21 * idx + 16);

                auto g11_yyyzz_0 = primBuffer.data(g11off + 21 * idx + 17);

                auto g11_yyzzz_0 = primBuffer.data(g11off + 21 * idx + 18);

                auto g11_yzzzz_0 = primBuffer.data(g11off + 21 * idx + 19);

                auto g11_zzzzz_0 = primBuffer.data(g11off + 21 * idx + 20);

                // set up pointers to (SI|g(r,r')|SS)^(m) integrals

                auto g_xxxxxx_0 = primBuffer.data(goff + 28 * idx);

                auto g_xxxxxy_0 = primBuffer.data(goff + 28 * idx + 1);

                auto g_xxxxxz_0 = primBuffer.data(goff + 28 * idx + 2);

                auto g_xxxxyy_0 = primBuffer.data(goff + 28 * idx + 3);

                auto g_xxxxyz_0 = primBuffer.data(goff + 28 * idx + 4);

                auto g_xxxxzz_0 = primBuffer.data(goff + 28 * idx + 5);

                auto g_xxxyyy_0 = primBuffer.data(goff + 28 * idx + 6);

                auto g_xxxyyz_0 = primBuffer.data(goff + 28 * idx + 7);

                auto g_xxxyzz_0 = primBuffer.data(goff + 28 * idx + 8);

                auto g_xxxzzz_0 = primBuffer.data(goff + 28 * idx + 9);

                auto g_xxyyyy_0 = primBuffer.data(goff + 28 * idx + 10);

                auto g_xxyyyz_0 = primBuffer.data(goff + 28 * idx + 11);

                auto g_xxyyzz_0 = primBuffer.data(goff + 28 * idx + 12);

                auto g_xxyzzz_0 = primBuffer.data(goff + 28 * idx + 13);

                auto g_xxzzzz_0 = primBuffer.data(goff + 28 * idx + 14);

                auto g_xyyyyy_0 = primBuffer.data(goff + 28 * idx + 15);

                auto g_xyyyyz_0 = primBuffer.data(goff + 28 * idx + 16);

                auto g_xyyyzz_0 = primBuffer.data(goff + 28 * idx + 17);

