                    g_z_xxzzzz[k] = pbz * g10_0_xxzzzz[k] + fr * g11_0_xxzzzz[k] + 4.0 * f2t * gk_0_xxzzz[k];

                    g_z_xyyyyy[k] = pbz * g10_0_xyyyyy[k] + fr * g11_0_xyyyyy[k];

                    g_z_xyyyyz[k] = pbz * g10_0_xyyyyz[k] + fr * g11_0_xyyyyz[k] + f2t * gk_0_xyyyy[k];

                    g_z_xyyyzz[k] = pbz * g10_0_xyyyzz[k] + fr * g11_0_xyyyzz[k] + 2.0 * f2t * gk_0_xyyyz[k];

                    g_z_xyyzzz[k] = pbz * g10_0_xyyzzz[k] + fr * g11_0_xyyzzz[k] + 3.0 * f2t * gk_0_xyyzz[k];

                    g_z_xyzzzz[k] = pbz * g10_0_xyzzzz[k] + fr * g11_0_xyzzzz[k] + 4.0 * f2t * gk_0_xyzzz[k];

                    g_z_xzzzzz[k] = pbz * g10_0_xzzzzz[k] + fr * g11_0_xzzzzz[k] + 5.0 * f2t * gk_0_xzzzz[k];

                    g_z_yyyyyy[k] = pbz * g10_0_yyyyyy[k] + fr * g11_0_yyyyyy[k];

                    g_z_yyyyyz[k] = pbz * g10_0_yyyyyz[k] + fr * g11_0_yyyyyz[k] + f2t * gk_0_yyyyy[k];

