                    g_z_yzzzzz[k] = pbz * g10_0_yzzzzz[k] + fr * g11_0_yzzzzz[k] + 5.0 * f2t * gk_0_yzzzz[k];

                    g_z_zzzzzz[k] = pbz * g10_0_zzzzzz[k] + fr * g11_0_zzzzzz[k] + 6.0 * f2t * gk_0_zzzzz[k];
