        auto fga = braGtoPairsBlock.getFactorsOneOverXi();

        // determine dimensions of GTOs pairs batch

        auto ndim = ketGtoPairsBlock.getNumberOfScreenedPrimPairs();

        if (isBraEqualKet)
        {
            ndim = ketGtoPairsBlock.getNumberOfPrimPairs(iContrPair);
        }

