                    g_zz_xxxyzz[k] = pbz * g10_z_xxxyzz[k] + fr * g11_z_xxxyzz[k] + f2g * (g20_0_xxxyzz[k] - fgz * g21_0_xxxyzz[k]) + 2.0 * f2t * gk_z_xxxyz[k];

                    g_zz_xxxzzz[k] = pbz * g10_z_xxxzzz[k] + fr * g11_z_xxxzzz[k] + f2g * (g20_0_xxxzzz[k] - fgz * g21_0_xxxzzz[k]) + 3.0 * f2t * gk_z_xxxzz[k];

                    g_zz_xxyyyy[k] = pbz * g10_z_xxyyyy[k] + fr * g11_z_xxyyyy[k] + f2g * (g20_0_xxyyyy[k] - fgz * g21_0_xxyyyy[k]);

                    g_zz_xxyyyz[k] = pbz * g10_z_xxyyyz[k] + fr * g11_z_xxyyyz[k] + f2g * (g20_0_xxyyyz[k] - fgz * g21_0_xxyyyz[k]) + f2t * gk_z_xxyyy[k];

                    g_zz_xxyyzz[k] = pbz * g10_z_xxyyzz[k] + fr * g11_z_xxyyzz[k] + f2g * (g20_0_xxyyzz[k] - fgz * g21_0_xxyyzz[k]) + 2.0 * f2t * gk_z_xxyyz[k];

                    g_zz_xxyzzz[k] = pbz * g10_z_xxyzzz[k] + fr * g11_z_xxyzzz[k] + f2g * (g20_0_xxyzzz[k] - fgz * g21_0_xxyzzz[k]) + 3.0 * f2t * gk_z_xxyzz[k];

                    g_zz_xxzzzz[k] = pbz * g10_z_xxzzzz[k] + fr * g11_z_xxzzzz[k] + f2g * (g20_0_xxzzzz[k] - fgz * g21_0_xxzzzz[k]) + 4.0 * f2t * gk_z_xxzzz[k];

                    g_zz_xyyyyy[k] = pbz * g10_z_xyyyyy[k] + fr * g11_z_xyyyyy[k] + f2g * (g20_0_xyyyyy[k] - fgz * g21_0_xyyyyy[k]);

                    g_zz_xyyyyz[k] = pbz * g10_z_xyyyyz[k] + fr * g11_z_xyyyyz[k] + f2g * (g20_0_xyyyyz[k] - fgz * g21_0_xyyyyz[k]) + f2t * gk_z_xyyyy[k];

                    g_zz_xyyyzz[k] = pbz * g10_z_xyyyzz[k] + fr * g11_z_xyyyzz[k] + f2g * (g20_0_xyyyzz[k] - fgz * g21_0_xyyyzz[k]) + 2.0 * f2t * gk_z_xyyyz[k];

