                    g_zzz_xyyyyy[k] = pbz * g10_zz_xyyyyy[k] + fr * g11_zz_xyyyyy[k] + f2g * (2.0 * g20_z_xyyyyy[k] - 2.0 * fgz * g21_z_xyyyyy[k]);

                    g_zzz_xyyyyz[k] = pbz * g10_zz_xyyyyz[k] + fr * g11_zz_xyyyyz[k] + f2g * (2.0 * g20_z_xyyyyz[k] - 2.0 * fgz * g21_z_xyyyyz[k]) + f2t * gk_zz_xyyyy[k];

                    g_zzz_xyyyzz[k] = pbz * g10_zz_xyyyzz[k] + fr * g11_zz_xyyyzz[k] + f2g * (2.0 * g20_z_xyyyzz[k] - 2.0 * fgz * g21_z_xyyyzz[k]) + 2.0 * f2t * gk_zz_xyyyz[k];

                    g_zzz_xyyzzz[k] = pbz * g10_zz_xyyzzz[k] + fr * g11_zz_xyyzzz[k] + f2g * (2.0 * g20_z_xyyzzz[k] - 2.0 * fgz * g21_z_xyyzzz[k]) + 3.0 * f2t * gk_zz_xyyzz[k];

                    g_zzz_xyzzzz[k] = pbz * g10_zz_xyzzzz[k] + fr * g11_zz_xyzzzz[k] + f2g * (2.0 * g20_z_xyzzzz[k] - 2.0 * fgz * g21_z_xyzzzz[k]) + 4.0 * f2t * gk_zz_xyzzz[k];

                    g_zzz_xzzzzz[k] = pbz * g10_zz_xzzzzz[k] + fr * g11_zz_xzzzzz[k] + f2g * (2.0 * g20_z_xzzzzz[k] - 2.0 * fgz * g21_z_xzzzzz[k]) + 5.0 * f2t * gk_zz_xzzzz[k];

