                    g_yzzz_zzzzzz[k] = pby * g10_zzz_zzzzzz[k] + fr * g11_zzz_zzzzzz[k];

                    // leading z component

                    fr = wpz[k];

                    g_zzzz_xxxxxx[k] = pbz * g10_zzz_xxxxxx[k] + fr * g11_zzz_xxxxxx[k] + f2g * (3.0 * g20_zz_xxxxxx[k] - 3.0 * fgz * g21_zz_xxxxxx[k]);

                    g_zzzz_xxxxxy[k] = pbz * g10_zzz_xxxxxy[k] + fr * g11_zzz_xxxxxy[k] + f2g * (3.0 * g20_zz_xxxxxy[k] - 3.0 * fgz * g21_zz_xxxxxy[k]);

                    g_zzzz_xxxxxz[k] = pbz * g10_zzz_xxxxxz[k] + fr * g11_zzz_xxxxxz[k] + f2g * (3.0 * g20_zz_xxxxxz[k] - 3.0 * fgz * g21_zz_xxxxxz[k]) + f2t * gk_zzz_xxxxx[k];

                    g_zzzz_xxxxyy[k] = pbz * g10_zzz_xxxxyy[k] + fr * g11_zzz_xxxxyy[k] + f2g * (3.0 * g20_zz_xxxxyy[k] - 3.0 * fgz * g21_zz_xxxxyy[k]);

                    g_zzzz_xxxxyz[k] = pbz * g10_zzz_xxxxyz[k] + fr * g11_zzz_xxxxyz[k] + f2g * (3.0 * g20_zz_xxxxyz[k] - 3.0 * fgz * g21_zz_xxxxyz[k]) + f2t * gk_zzz_xxxxy[k];

                    g_zzzz_xxxxzz[k] = pbz * g10_zzz_xxxxzz[k] + fr * g11_zzz_xxxxzz[k] + f2g * (3.0 * g20_zz_xxxxzz[k] - 3.0 * fgz * g21_zz_xxxxzz[k]) + 2.0 * f2t * gk_zzz_xxxxz[k];

