                    g_zzzz_xyyyyy[k] = pbz * g10_zzz_xyyyyy[k] + fr * g11_zzz_xyyyyy[k] + f2g * (3.0 * g20_zz_xyyyyy[k] - 3.0 * fgz * g21_zz_xyyyyy[k]);

                    g_zzzz_xyyyyz[k] = pbz * g10_zzz_xyyyyz[k] + fr * g11_zzz_xyyyyz[k] + f2g * (3.0 * g20_zz_xyyyyz[k] - 3.0 * fgz * g21_zz_xyyyyz[k]) + f2t * gk_zzz_xyyyy[k];

