                    g_zzzz_zzzzzz[k] = pbz * g10_zzz_zzzzzz[k] + fr * g11_zzz_zzzzzz[k] + f2g * (3.0 * g20_zz_zzzzzz[k] - 3.0 * fgz * g21_zz_zzzzzz[k]) + 6.0 * f2t * gk_zzz_zzzzz[k];
